import React from 'react'

export default function Navbar() {
    return (
            <ul className='m-0 p-0 overflow-hidden bg-slate-900 text-white fixed'>
                <li className='float-left'><Link to="/" className="block text-center px-5 hover:bg-slate-800"></Link></li>
                <li className='float-left'><a className="block text-center px-5 hover:bg-slate-800" href="#news">News</a></li>
                <li className='float-left'><a className="block text-center px-5 hover:bg-slate-800" href="#contact">Contact</a></li>
                <li className='float-left'><a className="block text-center px-5 hover:bg-slate-800" href="#about">About</a></li>
            </ul>
    )
}
